import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-success">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">Supermercado</Link>
        <div>
          <ul className="navbar-nav me-auto">
            <li className="nav-item"><Link className="nav-link" to="/bebidas">Bebidas</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/alimentos">Alimentos</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/hogar">Hogar</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/otros">Otros</Link></li>
          </ul>
        </div>
      </div>
    </nav>
  );
}
